INSERT INTO plant_plant VALUES(1,'Amarante','Amaranthus','Légumes','Plante feuillue comestible, riche en protéines et en nutriments.','Mars - Mai','Juin - Septembre','20°C - 30°C','Plein soleil','Sol bien drainé, riche en matière organique','6.0 - 7.5','Bihebdomadaire','Maintenir le sol humide sans excès d’eau.','["https://agroflex.autafrika.com/storage/images/plants/amarante0.jpg", "https://agroflex.autafrika.com/storage/images/plants/amarante1.jpg"]','["Taillez r\\u00e9guli\\u00e8rement pour favoriser la croissance des feuilles.", "\\u00c9vitez l\\u2019exc\\u00e8s d\\u2019eau pour pr\\u00e9venir les maladies racinaires."]');
INSERT INTO plant_plant VALUES(2,'Banane','Musa spp.','Fruits','Plante tropicale produisant des fruits riches en potassium.','Toute l’année en climat chaud','9 à 12 mois après la plantation','25°C - 35°C','Plein soleil','Sol riche, humifère et bien drainé','5.5 - 7.0','2 à 3 fois par semaine','Nécessite une humidité constante mais sans stagnation d’eau.','["https://agroflex.autafrika.com/storage/images/plants/banane0.webp", "https://agroflex.autafrika.com/storage/images/plants/banane1.png"]','["Ajoutez du compost organique pour stimuler la croissance.", "Taillez les feuilles mortes pour \\u00e9viter les maladies."]');
INSERT INTO plant_plant VALUES(3,'Citron','Citrus limon','Fruits','Agrume produisant des fruits acides et vitaminés.','Printemps ou début de l’automne','6 à 12 mois après la floraison','15°C - 30°C','Plein soleil','Sol bien drainé, légèrement acide','5.5 - 6.5','Hebdomadaire','Arrosage profond, espacé pour éviter le stress hydrique.','["https://agroflex.autafrika.com/storage/images/plants/citron0.jpg", "https://agroflex.autafrika.com/storage/images/plants/citron1.jpg", "https://agroflex.autafrika.com/storage/images/plants/citron2.jpg"]','["\\u00c9vitez l\\u2019exc\\u00e8s d\\u2019arrosage pour pr\\u00e9venir la pourriture des racines.", "Taillez les branches pour favoriser une meilleure fructification."]');
INSERT INTO plant_plant VALUES(4,'Courge','Cucurbita spp.','Légumes','Plante potagère produisant des fruits comestibles riches en vitamines.','Avril - Juin','Août - Octobre','18°C - 30°C','Plein soleil','Sol riche, bien drainé','6.0 - 7.5','Bihebdomadaire','Arrosage abondant en période chaude.','["https://agroflex.autafrika.com/storage/images/plants/courge0.jpg", "https://agroflex.autafrika.com/storage/images/plants/courge1.jpg"]','["Paillez le sol pour conserver l\\u2019humidit\\u00e9.", "Taillez les tiges pour favoriser la production de fruits."]');
INSERT INTO plant_plant VALUES(5,'Épinard','Spinacia oleracea','Légumes','Légume à feuilles vertes riche en nutriments.','Mars - Avril','Mai - Juillet','5°C - 25°C','Mi-ombre','Sol limoneux et bien drainé','6.5','Bihebdomadaire','Arrosage deux fois par semaine pour maintenir l''humidité.','["https://agroflex.autafrika.com/storage/images/plants/epinard0.jpg", "https://agroflex.autafrika.com/storage/images/plants/epinard1.jpeg"]','["\\u00c9vitez le stress hydrique pour \\u00e9viter la mont\\u00e9e en graines.", "Faites des semis successifs pour r\\u00e9colter plus longtemps."]');
INSERT INTO plant_plant VALUES(6,'Haricot','Phaseolus vulgaris','Légumineuses','Légume riche en protéines et facile à cultiver.','Mars - Juin','Juillet - Octobre','15°C - 30°C','Plein soleil','Sol bien drainé, riche en matière organique','6.0 - 7.5','Hebdomadaire','Arrosage régulier sans détremper le sol.','["https://agroflex.autafrika.com/storage/images/plants/haricot0.jpg", "https://agroflex.autafrika.com/storage/images/plants/haricot1.jpg"]','["Installer des tuteurs pour les vari\\u00e9t\\u00e9s grimpantes.", "\\u00c9vitez l''exc\\u00e8s d''azote pour \\u00e9viter trop de feuillage au d\\u00e9triment des gousses."]');
INSERT INTO plant_plant VALUES(7,'Maïs','Zea mays','Céréales','Céréale essentielle cultivée dans le monde entier.','Avril - Juin','Août - Octobre','18°C - 35°C','Plein soleil','Sol riche en matière organique et bien drainé','5.5 - 7.0','2 à 3 fois par semaine','Arrosage régulier surtout en période de floraison.','["https://agroflex.autafrika.com/storage/images/plants/mais0.jpg", "https://agroflex.autafrika.com/storage/images/plants/mais1.jpg"]','["\\u00c9claircir les plants pour \\u00e9viter la concurrence.", "Associer avec des l\\u00e9gumineuses pour am\\u00e9liorer la fertilit\\u00e9 du sol."]');
INSERT INTO plant_plant VALUES(8,'Mangue','Mangifera indica','Fruits','Arbre fruitier tropical produisant des mangues sucrées et juteuses.','Printemps','6 à 10 mois après la floraison','25°C - 35°C','Plein soleil','Sol bien drainé, riche et profond','5.5 - 7.5','Hebdomadaire','Arrosage réduit après l’établissement de l’arbre.','["https://agroflex.autafrika.com/storage/images/plants/mangue0.webp", "https://agroflex.autafrika.com/storage/images/plants/mangue1.jpg", "https://agroflex.autafrika.com/storage/images/plants/mangue2.jpeg"]','["Tailler r\\u00e9guli\\u00e8rement pour favoriser la fructification.", "Appliquer du paillis autour de l\\u2019arbre pour conserver l\\u2019humidit\\u00e9."]');
INSERT INTO plant_plant VALUES(9,'Manioc','Manihot esculenta','Tubercules','Plante tropicale produisant des tubercules riches en amidon.','Toute l’année en climat chaud','8 à 12 mois après la plantation','20°C - 35°C','Plein soleil','Sol bien drainé, sableux ou limoneux','5.5 - 7.5','Hebdomadaire','Arrosage modéré pour éviter la pourriture des racines.','["https://agroflex.autafrika.com/storage/images/plants/manioc0.jpg", "https://agroflex.autafrika.com/storage/images/plants/manioc1.webp"]','["Taillez les tiges pour stimuler la production de tubercules.", "\\u00c9vitez les sols argileux qui retiennent trop d\\u2019eau."]');
INSERT INTO plant_plant VALUES(10,'Orange','Citrus sinensis','Fruits','Agrume produisant des fruits sucrés et juteux.','Printemps ou début de l’automne','6 à 12 mois après la floraison','15°C - 30°C','Plein soleil','Sol bien drainé, légèrement acide','5.5 - 6.5','Hebdomadaire','Arrosage profond pour encourager un bon enracinement.','["https://agroflex.autafrika.com/storage/images/plants/orange0.jpeg", "https://agroflex.autafrika.com/storage/images/plants/orange1.avif"]','["Taillez les branches mortes pour favoriser une meilleure production.", "Utilisez du compost organique pour enrichir le sol."]');
INSERT INTO plant_plant VALUES(11,'Pomme de terre','Solanum tuberosum','Tubercules','Plante potagère cultivée pour ses tubercules comestibles.','Mars - Mai','Juillet - Septembre','10°C - 25°C','Plein soleil','Sol léger, riche en humus, bien drainé','5.0 - 6.5','Bihebdomadaire','Arrosage modéré pour éviter les maladies fongiques.','["https://agroflex.autafrika.com/storage/images/plants/pdt0.jpg", "https://agroflex.autafrika.com/storage/images/plants/pdt1.webp", "https://agroflex.autafrika.com/storage/images/plants/pdt2.jpg"]','["Buttez les plants pour prot\\u00e9ger les tubercules de la lumi\\u00e8re.", "\\u00c9vitez l\\u2019exc\\u00e8s d\\u2019azote qui favorise le feuillage au d\\u00e9triment des tubercules."]');
INSERT INTO plant_plant VALUES(12,'Patate douce','Ipomoea batatas','Tubercules','Plante vivace cultivée pour ses tubercules riches en glucides et vitamines.','Mars - Juin','Septembre - Décembre','20°C - 30°C','Plein soleil','Sol meuble, bien drainé et riche en matière organique','5.5 - 6.5','Hebdomadaire','Arrosage modéré, éviter l’excès d’eau pour prévenir la pourriture des tubercules.','["https://agroflex.autafrika.com/storage/images/plants/pd0.jpeg", "https://agroflex.autafrika.com/storage/images/plants/pd1.jpg", "https://agroflex.autafrika.com/storage/images/plants/pd2.jpg"]','["Paillez le sol pour conserver l\\u2019humidit\\u00e9 et limiter les mauvaises herbes.", "R\\u00e9coltez les tubercules avant les premi\\u00e8res gel\\u00e9es."]');
INSERT INTO plant_plant VALUES(13,'Soja','Glycine max','Légumineuses','Légumineuse utilisée pour l’alimentation humaine et animale, riche en protéines.','Avril - Juin','Septembre - Novembre','20°C - 30°C','Plein soleil','Sol bien drainé, riche en matière organique','6.0 - 7.0','Hebdomadaire','Maintenir une humidité constante, éviter le stress hydrique.','["https://agroflex.autafrika.com/storage/images/plants/soja0.jpg", "https://agroflex.autafrika.com/storage/images/plants/soja1.jpg"]','["Associez le soja avec d\\u2019autres cultures pour enrichir le sol en azote.", "\\u00c9vitez un exc\\u00e8s d\\u2019humidit\\u00e9 pour pr\\u00e9venir les maladies fongiques."]');
