
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY SERIAL, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY SERIAL, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY SERIAL, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY SERIAL, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY SERIAL, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "accounts_user_groups" ("id" integer NOT NULL PRIMARY KEY SERIAL, "user_id" bigint NOT NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "accounts_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY SERIAL, "user_id" bigint NOT NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY SERIAL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "plant_plant" ("id" integer NOT NULL PRIMARY KEY SERIAL, "name" varchar(100) NOT NULL, "scientific_name" varchar(150) NOT NULL, "category" varchar(100) NOT NULL, "description" text NOT NULL, "planting_period" varchar(50) NOT NULL, "harvest_period" varchar(50) NOT NULL, "temperature" varchar(50) NOT NULL, "sun_exposure" varchar(50) NOT NULL, "soil_type" varchar(100) NOT NULL, "soil_ph" varchar(20) NOT NULL, "watering_frequency" varchar(50) NOT NULL, "watering_notes" text NOT NULL, "images" text NOT NULL CHECK ((JSON_VALID("images") OR "images" IS NULL)), "tips" text NOT NULL CHECK ((JSON_VALID("tips") OR "tips" IS NULL)));
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "token_blacklist_blacklistedtoken" ("blacklisted_at" datetime NOT NULL, "token_id" bigint NOT NULL UNIQUE REFERENCES "token_blacklist_outstandingtoken" ("id") DEFERRABLE INITIALLY DEFERRED, "id" integer NOT NULL PRIMARY KEY SERIAL);
CREATE TABLE IF NOT EXISTS "token_blacklist_outstandingtoken" ("token" text NOT NULL, "created_at" datetime NULL, "expires_at" datetime NOT NULL, "user_id" bigint NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED, "jti" varchar(255) NOT NULL UNIQUE, "id" integer NOT NULL PRIMARY KEY SERIAL);
CREATE TABLE IF NOT EXISTS "accounts_blacklistedtoken" ("id" integer NOT NULL PRIMARY KEY SERIAL, "token" varchar(500) NOT NULL UNIQUE, "blacklisted_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "market_category" ("id" integer NOT NULL PRIMARY KEY SERIAL, "name" varchar(100) NOT NULL, "description" text NULL);
CREATE TABLE IF NOT EXISTS "market_order" ("id" integer NOT NULL PRIMARY KEY SERIAL, "total_price" decimal NOT NULL, "status" varchar(20) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "buyer_id" bigint NOT NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "market_paymentmethod" ("id" integer NOT NULL PRIMARY KEY SERIAL, "method" varchar(2) NOT NULL, "identifier" varchar(100) NOT NULL, "is_primary" bool NOT NULL, "user_id" bigint NOT NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "market_payment" ("id" integer NOT NULL PRIMARY KEY SERIAL, "transaction_id" char(32) NOT NULL UNIQUE, "amount" decimal NOT NULL, "status" varchar(20) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "order_id" bigint NOT NULL UNIQUE REFERENCES "market_order" ("id") DEFERRABLE INITIALLY DEFERRED, "payment_method_id" bigint NULL REFERENCES "market_paymentmethod" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "market_product" ("id" integer NOT NULL PRIMARY KEY SERIAL, "name" varchar(200) NOT NULL, "description" text NOT NULL, "price" decimal NOT NULL, "quantity" integer unsigned NOT NULL CHECK ("quantity" >= 0), "unit_of_measure" varchar(2) NOT NULL, "condition" varchar(2) NOT NULL, "image" varchar(100) NULL, "is_active" bool NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "category_id" bigint NULL REFERENCES "market_category" ("id") DEFERRABLE INITIALLY DEFERRED, "seller_id" bigint NOT NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "market_orderitem" ("id" integer NOT NULL PRIMARY KEY SERIAL, "quantity" integer unsigned NOT NULL CHECK ("quantity" >= 0), "price" decimal NOT NULL, "order_id" bigint NOT NULL REFERENCES "market_order" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" bigint NOT NULL REFERENCES "market_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "accounts_role" ("id" integer NOT NULL PRIMARY KEY SERIAL, "name" varchar(2) NOT NULL);
CREATE TABLE IF NOT EXISTS "accounts_user_roles" ("id" integer NOT NULL PRIMARY KEY SERIAL, "user_id" bigint NOT NULL REFERENCES "accounts_user" ("id") DEFERRABLE INITIALLY DEFERRED, "role_id" bigint NOT NULL REFERENCES "accounts_role" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "accounts_user" ("id" integer NOT NULL PRIMARY KEY SERIAL, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "email" varchar(254) NOT NULL UNIQUE, "date_of_birth" date NULL, "phone_number" varchar(15) NOT NULL, "image" varchar(100) NULL, "username" varchar(150) NOT NULL UNIQUE);

